Cable and X-Force #11
Publisher:  Marvel
Publication Date:  July 17, 2013

Writer:  Dennis Hopeless
Artists:  Salvador Larroca
Colorists:  Frank D'Armata
Letterer:  Joe Sabino
Cover Artists:  Salvador Larroca and Frank D'Armata

As tensions rise between X-Force and the Uncanny Avengers, Cable's precognitive visions grow increasingly relentless. X-Force must race against the clock to stop each terrible vision from coming true...but what will happen if they fail? In the world of X-Force, a minute can mean the difference between life and death.

